import React from "react";

const SearchLeft = () => {
  return (
    <div className="col-md-3">
      <h1>Search</h1>
      <label>Destination</label>
      <input type="text" />
      <label>Check-in Date</label>
      <input type="date" />
    </div>
  );
};
export default SearchLeft;
